import Table from './Table';
import React, { useState, useEffect } from 'react';

function App() {
  const [todos, setTodos] = useState([]);

  useEffect(()=>{
    fetch('https://dummyjson.com/todos')
    .then(res => res.json())
    .then(data => {setTodos(data.todos)});   
  }, []);

  return (
    <Table todos={todos}/>
  );
}

export default App;
